import ColorScheme from './ColorScheme.js'

class ColorSchemeList {
    constructor () {
        this.colorSchemes = [
            new ColorScheme("new-york-times", "NYT Style", ["#ffeca0", "#ffda00", "#a7d8ff", "#3f84fb"]),
            new ColorScheme("lemon-lime", "Lemon Lime", ["#f7ffb0", "#edff4a", "#a4e07b", "#64b05a"]),
            new ColorScheme("roses-are-red", "Roses are Red", ["#f7dfe3", "#ffc7d1", "#f06e84", "#B32134"]),
            new ColorScheme("baby-shower", "Baby Shower", ["#ffdbf8", "#fcb6ef", "#98ddfa", "#53b3e6"]),
            new ColorScheme("sunset", "Sunset", ["#ffef99","#ffe44f", "#ffa45e", "#ff6726"])
        ]
    }

    getByInd (ind) {
        return this.colorSchemes[ind]
    }

    getByKey (key) {
        return this.colorSchemes.find(c => c.key === key)
    }

    getByName (name) {
        return this.colorSchemes.find(c => c.displayName === name)
    }
}

export default new ColorSchemeList()
